“Id love for this to go viral for many reasons. I hope sharing this with the people on social media it brings light to what happened in Kabul through my point of view. This is all my footage and i also edited everything. I hope this answers questions but also provokes you to ask more. Share and repost this as much as possible. To my brothers and sisters who were there i made this for you and your family. When you have the lack of ability to explain all that happened in those two weeks, show them this. Stand tall and wear the last two weeks on your chest. I havent found a way to explain it with anywords i know.  These clips are not from one or two days, they are from two straight weeks of worsening conditions. This is barely even a glimpse. Many of us have felt a purpose greater than ourselves written in history for ever, the need to protect defend and fight for what we believe is right. Living in the shadows of the legends and giants who wore this uniform before us. To our knowledge ending a dark era for the United States military. Not knowing or caring about the circumstances. Only caring about what needs to be done and how we need to do it, putting ourselves last. Many of us joined because we liked fighting and were good with adversity and conflict. Two weeks in Kabul at HKIA put all of that to the test. I cant say enough how proud i am of the Marines i serve with. Most of us old enough to have witnessed the day this war started, and many of us currently serving as teenagers. Odds were stacked against us, circumstances undeniably out of our control but we never let it deter our tenacious approach towards our mission at hand. Adversity and challenges happened 24/7 many at the same time, and almost all had no predesignated plan. We did our absolute best and remained stoic through the sleepless nights and round the clock work with minimal food and water. Staying up for two or more days straight at a time grinding but remaining intensely vigilant. I serve with someones father/son/brother/sister/daughter/mother and i never take that lightly. I take it as a responsibility to never let those people down.”

Glad that they had the medical supplies on hand needed to save a life!

